description:
Studio: Catalina Video

Director: Brad Austin

Cast: Eric York, Graham , Hans Ebson, Jake Summers, Kirk Van Buren, Lee Hassalo, Sam Burton, Scott Spears, and Tuck Johnson

Synopsis: The best Head Coach in the county shows his students some new moves. These hot and horny wrestlers learn to pin each other down in the locker room, on the mat and in the showers. Director BRAD AUSTIN doesn't disappoint in this sweaty sports tale starring JAKE SUMMERS, ERIK YORK, TUCK JOHNSON and HANS EBSON. 

